    render() {
        return (
            <div id ={styles.LoginWrapper}>
                <Card id={styles.LoginCard}>
                    <Form class={styles.LoginForm}>
                        <img src={Logo} alt="Logo" class={styles.Logo}/>
                        <h2 id={styles.loginH2}>Login</h2>
                            <Form.Group className="mb-3" controlId="formBasicEmail" class={styles.formGroup}>
                                <Row>
                                    <Col>
                                        <Form.Label class={styles.formLabel}>Email</Form.Label> 
                                        <Form.Control type="email" placeholder="" className={styles.formControl}/>
                                    </Col>
                                </Row>
                            </Form.Group>


                            <Form.Group className="mb-3" controlId="formBasicPassword" class={styles.formGroup}>
                                <Row>
                                    <Col>
                                        <Form.Label class={styles.formLabel}>Password</Form.Label>
                                        <Form.Control type="password" placeholder="" className={styles.formControl}/>
                                    </Col>
                                </Row>
                    </Form.Group>

                        <Button className={styles.LoginBtn} variant="primary" type="submit" onClick={this
                        .submitLogin.bind(this)}>
                        SignUp </Button>

                        <div id={styles.ForgotPassword}><a href='#'><b>Forgot password?</b></a></div>
                        <div id={styles.SignUpLink}>Need an account?&nbsp;<Link to="/SignUp"><b>Sign Up</b></Link></div>
                    </Form>
                </Card> 
            </div>    
        );
    }
}

export default LoginForm;
